import React from 'react'
import './Card.css'


let onImageClick = (url) => {
    console.log(url)

return(<div style = {{width: "100px"}}><img src={url} alt="Avatar" style={{ width: "500px" }}></img></div>)
}
const Card = (props) => {

    return (
        <>
        
        <div className="card">
            <div className="image">
            <img src={props.url} alt="Avatar" style={{ width: "100%" }} onClick = {() => onImageClick(props.url)}></img>
            </div>
            <div className="container">
                <h4><b>John Doe</b></h4>
                <p>Architect & Engineer</p>
            </div>
        </div>
        </>
    )
}

export default Card;
